DROP TABLE IF EXISTS `cupon`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `cupon` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'id de la entidad',
  `cliente_id` int DEFAULT NULL COMMENT 'en caso de estar el cupon asociado a un usuario.',
  `porcentaje` double DEFAULT NULL COMMENT 'porcentaje de descuento',
  `importe` double DEFAULT NULL COMMENT 'importe fijo de descuento',
  `compra_minima` double DEFAULT NULL COMMENT 'valor minimo de compra para aplicar descuento',
  `fecha_desde` timestamp NULL DEFAULT NULL COMMENT 'fecha de inicio de validez del cupon',
  `fecha_hasta` timestamp NULL DEFAULT NULL COMMENT 'fecha hasta de validez del cupon',
  `codigo` varchar(32) DEFAULT NULL COMMENT 'codigo del cupon',
  `titulo` varchar(64) DEFAULT NULL COMMENT 'titulo para el cupon',
  `imagen` blob NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`),
  KEY `fk_cupon_usuario1_idx` (`cliente_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
